import {
    HomeOutlined,
    InboxOutlined,
    HourglassOutlined,
    InsertRowAboveOutlined,
    ManOutlined,
    NotificationOutlined,
    PartitionOutlined,
    PropertySafetyOutlined,
    MergeCellsOutlined
  } from '@ant-design/icons'
let menuList = [
    {
        path:"/home",
        icon:"HomeOutlined",
        name:"首页"
    },
    {
        path:"/produts",
        icon:"InboxOutlined",
        name:"商品",
        children:[
            {
                path:"/categoty",
                icon:"HourglassOutlined",
                name:"品类管理"
            },{
                path:"/produt",
                icon:"InsertRowAboveOutlined",
                name:"商品管理"
            }
        ]
    },{
        path:"/user",
        icon:"ManOutlined",
        name:"用户管理"
    },{
        path:"/role",
        icon:"NotificationOutlined",
        name:"角色管理"
    },{
        path:"/charts",
        icon:"PartitionOutlined",
        name:"数据",
        children:[
            {
                path:"/charts/bar",
                icon:"PropertySafetyOutlined",
                name:"圆柱体"
            },{
                path:"/charts/pie",
                icon:"MergeCellsOutlined",
                name:"折线图"
            }
        ]
    }
]
export default menuList
